import React from 'react';
import { Loader } from 'react-loader-spinner';

function LoaderSpinner() {
  return (
    <div>
      <h1>Loading Data...</h1>
      <Loader
            type="TailSpin"
            color="rgb(155, 236, 34)"
            height={70}
            width={70}
            timeout={5000}
        />
    </div>
  );
}

export default LoaderSpinner;
